import { Provider } from "react-redux";
import store from "./store";
import HeaderComponent from "./compenents/header";
import ContentComponent from "./compenents/contentComponent";
import FooterComponent from "./compenents/footerComponent";

function App() {
  return (
    <Provider store={store}>
      <div className="table w-full h-full table-fixed bg-gray-100">
          <HeaderComponent />
        <div className="p-2 w-full table-row">
          <ContentComponent />
        </div>
        <div className="bg-white fixed w-full bottom-0 border-2 border-gray-200 rounded-t-3xl">
          <FooterComponent />
        </div>
      </div>
    </Provider>
  );
}

export default App;
